import './App.css';
import PokemonGame from "./PokemonGame.js";
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div class="fadeMe">
      <Container>
        <PokemonGame/>
      </Container>
    </div>
  );
}

export default App;
